import React from "react";
import { BannerItems } from "./style";
const BannerItem = props => {
    const {item} = props;
    return(
        <BannerItems className="banner-item" item={item}>
            <img className="image-item" src={item} alt=""/>
        </BannerItems>
    );
}
export default BannerItem;
